import hero from "../util/hero.jpg"

const Home = (props) => {
  function center () {
    const homeDiv = document.getElementById('Home')

    const centerHome = () => {
      var left = window.innerWidth / 2 - homeDiv.clientWidth / 2 + "px"
      var top = window.innerHeight / 2 - homeDiv.clientWidth / 2 + "px"
    }
    return {
      "margin-left":left,
      "margin-top":top
    }
  }

  return (
    <div className="Home-container">
      <div className="Home" style={center}>
        <div className="Home-left">
          <img src={hero} alt="hero image"/>
        </div>
        <div className="Home-right">
          <h2>Cosmic Darlings</h2>
          <p>Cosmic Darlings are a carefully curated collection of 10,000 robots. Each Darling is unique and consists of both hand drawn and real world traits.</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
